(487, 'laminat/signature', 'Signature', NULL, '<h1>Signature</h1><p>Signature - новый эталон в производстве ламината - невероятно изысканная коллекция с водостойкой поверхностью. Она достойна своего имени</p>', 1, '2020-11-10 14:29:58', '2020-11-10 14:33:55'),
