(520, 'laminat/castle', 'Castle', NULL, '<h1>Castle</h1>Castle – это классический дизайн в современной интерпретации. В зависимости от узора, который вы хотите увидеть на своем полу, планки можно укладывать различными способами - со смещением на 1/2 и ¼ относительно предыдущего ряда.', 1, '2020-11-11 12:15:14', '2020-11-11 12:15:14'),
(531, 'laminat/classic', 'Classic', NULL, '<h1>Classic</h1><p>Classic - базовая коллекция с лёгким брашированием поверхности, микрофаской, толщиной 8 мм на любой вкус.</p>', 1, '2020-11-11 16:03:24', '2020-11-11 16:03:24'),
(568, 'laminat/desire', 'Desire', NULL, '<h1>Desire</h1><p>Особенная поверхность, мягкость и изящество, без V - образных фасок. Игра серебристых или золотистых нитей в древесных порах. Классический дизайн с новым трендом, металик.</p>', 1, '2020-11-12 11:11:55', '2020-11-12 11:11:55'),
(577, 'laminat/eligna', 'Eligna', NULL, '<h1>Eligna</h1><p>Eligna - первый в мире влагостойкий ламинат без фаски. Элегантные декоры толщиной 8мм с водоотталкивающей технологией. Отсутствие фасок придает вашему полу обтекаемую форму.</p>', 1, '2020-11-13 11:50:53', '2020-11-13 11:50:53'),
(610, 'laminat/impressive', 'Impressive', NULL, '<h1>Impressive</h1>Quick-Step с гордостью представляет новое поколение полов: самый натуральный водостойкий ламинат.\r\n\r\nИдеальный баланс структуры и фаски.\r\n\r\nУникальное водоотталкивающее покрытие фаски.', 1, '2020-11-16 23:48:29', '2020-11-16 23:48:29'),
