(1071, 'ustoychivost-k-pyatnam-i-tsarapinam', 'Устойчивость к пятнам и царапинам', NULL, '<h1>Устойчивость к пятнам и царапинам</h1><img src=\"/images/scratchguard.png\" style=\"border:none;padding: 0;padding-right: 20px;\">\r\n<p>Хотите , чтобы песок и пыль не оставляли царапин или пятен на полу.<br> Благодаря технологиям защиты Scratch Guard и Stain Guard можно не волноваться на этот счет: ламинированные и виниловые покрытия выдержат все, а уборка займет всего несколько минут.</p>', 1, '2021-01-28 21:21:03', '2021-01-28 21:21:03'),
(1072, '25-let-garantii', '25 лет гарантии', NULL, '<h1>На долгие годы</h1><img src=\"/images/25-year-warranty.png\" style=\"border:none;padding: 0;padding-right: 20px;\">\r\n<p>Компания Quick-Step предлагает ламинированные, виниловые и деревянные напольные покрытия, которые будут служить вашей семье долгие годы.<br>\r\nВы сможете спокойно отдыхать на своем уютном диване или на удобной кушетке, ведь компания Quick-Step предоставляет на все свои напольные покрытия для дома гарантию сроком на 25 лет и более*.</p>', 1, '2021-01-28 21:21:30', '2021-01-28 21:21:30'),
